function setDataOnChange(selector, next) {
  $(selector.field).on('change', function() {
    var id = $(this).val();
    $(next.field).select2('val', '');
    $(next.field).attr('disabled', false);

    var placeholder = $(next.field).attr('placeholder') ||
                           $element.data('placeholder') ||
                           'Elija una opción';

    $(next.field).select2({
      ajax: {
        url: next.url,
        dataType: 'json',
        type: 'GET',
        data: function(params) {
            if (params.term === undefined) {
              params.term = '';
            }
            return {
              school_id: id,
              text: params.term
            };
        },
        processResults: function(data) {
          var results = [];
          for (var key in data) {
            var res = data[key];
            results.push({id: res.id, text: res.name});
          }
          return {results: results, more: false};
        }
      },
      allowClear: true,
      placeholder: placeholder,
      locale: I18n.locale,
      language: {
        noResults: function() {
          return 'No se encontraron resultados';
        },
        searching: function() {
          return 'Buscando...';
        },
        loadingMore: function() {
          return 'Cargando más resultados...';
        },
        inputTooShort: function() {
          return 'Escriba al menos 3 letras';
        }
      }
    });
  });
}

function setCheckboxOnChange(selector, next) {
  $(next).attr('disabled', !$(selector).is(':checked'));
  $(selector).change(function() {
    $(next).attr('disabled', !$(this).is(':checked'));
  });
}

function setGraduatedOnChange(selector, next) {
  var graduated = ($(selector).val() == 'true');
  $(next).attr('disabled', graduated);
  //if (graduated) $(next).select2('val', '');
  $(selector).change(function() {
    var graduated = ($(this).val() == 'true');
    $(next).attr('disabled', graduated);
    //if (graduated) $(next).select2('val', '');
  });
}
